import React from 'react';
import './Main.css';

export default props => (
    <>
        <div>
            <h4 class="mt-3">Usuários</h4>
            <p class="text-muted">Cadastro de usuários: Incluir, Listar, Alterar e Excluir</p>

        </div>
        <main className="content container-fluid" >
            <div className="p-6 mt-10" >
                {props.children}
            </div>
        </main>
    </>
)
